import { createTheme } from "@material-ui/core";

export const themes = createTheme({
    palette: {
        primary: {
            //red
            main: '#397367',
            //maroon
            temp: '#63CCCA'
        },
        secondary: {
            //gray
            main: '#5DA399',

            temp:'#4285',
        },
        error: {
            main: '#f3e5f5',
        }
    },
});
